import React, { useEffect, useState } from "react";
import MemberCard from "./MemberCard";

const MemberList = props => {
  return (
    <div>
      {props.team.map(mem => {
        return <MemberCard mem={mem} memberToEdit={props.memberToEdit} />;
      })}
    </div>
  );
};

export default MemberList;
